import { useEffect, useRef } from 'react';
import SignaturePad from 'react-signature-canvas';
import './App.css';

const base64Image = '';

function App() {
  // https://www.npmjs.com/package/react-signature-canvas
  // https://morioh.com/p/f36c16f81697
  // https://www.npmtrends.com/react-canvas-draw-vs-react-signature-vs-react-signature-canvas-vs-react-signature-pad
  const sigCanvas = useRef(null);
  useEffect(()=>{
    sigCanvas.current.fromDataURL(`data:image/png;base64,${base64Image}`);
  },[]);
  const handleClear = () => sigCanvas.current.clear();
  const handleSave = () => {
    const trimmedCanvas = sigCanvas.current.getTrimmedCanvas();
    console.log('trimmedCanvas',trimmedCanvas);
    const dataURLWithoutSpaces = trimmedCanvas.toDataURL("image/png");
    console.log('dataURLWithoutSpaces',dataURLWithoutSpaces);
    const dataURLWithSpaces = sigCanvas.current.getCanvas().toDataURL("image/png");
    console.log('dataURLWithSpaces',dataURLWithSpaces);
  };
  return (
    <div className="App">
      <h1>SignaturePad</h1>
      <SignaturePad
        ref={sigCanvas}
        canvasProps={{
          className: "signatureCanvas"
        }}
      />
      <button onClick={handleClear}>clear</button>
      <button onClick={handleSave}>save</button>
    </div>
  );
}

export default App;
